function displayThumbnails(e){var n=document.getElementById("thumbnail-container"),t="";t+='<div class="thumbnail-page">';for(var a=0;a<e.length;a++)t+=`\n      <a href="https://youtu.be/${e[a]}" target="_blank">\n        <img class="thumbnail"\n            src="https://i.ytimg.com/vi/${e[a]}/mqdefault.jpg" \n            alt="thumbnail"></a>`,a%100==99?t+='</div><div class="thumbnail-page">':a%10==9&&(t+="<br>");n.innerHTML=t}function loadSignedIn(){document.getElementById("menu").innerHTML+='<button class="btn btn-lg btn-primary mt-3" id="refresh-btn">Refresh Thumbnails</button>',document.getElementById("thumbnail-container").innerHTML='<h5>No thumbnails are loaded. Press the "Refresh Thumbnails" button to view the thumbnails.</h5>',document.getElementById("about-list").innerHTML+='\n      <li>Thumbnails not loading? Try <a href="" id="signout-text">signing out</a> and signing back in.</li>\n      <li>\n        Missing some thumbnails? Make sure the missing videos are listed in the \n        <a href="https://docs.google.com/spreadsheets/d/1LNVjw5Hf2Ykp89jtxaX9itH5NOoudwaz0T74E7flZZg/edit#gid=485839191?usp=sharing"\n          target="_blank">"ADC Video Dashboard Input Data" Google Sheet</a>.\n      </li>\n    ';var e=document.getElementById("signout-text");e.addEventListener("click",handleSignout);var n=document.getElementById("refresh-btn");n.addEventListener("click",loadUploads),loadUploads()}function loadUploads(){document.getElementById("thumbnail-container").innerHTML='\n    <div class="text-center"><i class="fas fa-cog fa-3x fa-spin"></i></div>\n  ',requestSpreadsheetData("Input Data","Video List").then(e=>{const n=recordUploads(e);displayThumbnails(n),document.getElementById("error-container").className="d-none"}).catch(e=>{document.getElementById("thumbnail-container").innerHTML="",document.getElementById("error-container").className="d-block",document.getElementById("error-message").innerText=e.message})}function recordUploads(e){let n=[],t={},a=e[0];for(let e=0;e<a.length;e++)t[a[e]]=e;for(let a=e.length-1;a>=1;a--){let i=e[a],s=i[t["Video ID"]];n.push(s)}return n}